import { ProSidebar, Menu, MenuItem, SubMenu } from 'react-pro-sidebar';
import 'react-pro-sidebar/dist/css/styles.css';
import {houseStroke,messagesStroke,providersStroke} from "../assets/AssetsManager"
import "../Styles/SideMenu.scss"

export const SideMenu = () => {
//   const { state, dispatch } = useAppState();
//   console.log("****state", state);

  return (
    <div className="">
        <ProSidebar rtl={true}  style={{padding:"0px"}}>
            <Menu iconShape="square">
                    <SubMenu title="בניינים" icon={<img src={houseStroke}/>}>
                        <MenuItem>תצוגה כללית
                            <Link to="/generalView" />
                        </MenuItem>
                        <MenuItem className="MenuItem" >רשימת בניינים
                            <Link to="/building" />
                        </MenuItem>
                        <MenuItem >בניין חדש
                            <Link to="/building/new" />
                        </MenuItem>
                    </SubMenu>
                    <SubMenu title="הודעות" icon={<img src={messagesStroke}/>}>
                        <MenuItem>הודעות שנשלחו
                            <Link to="/message" />
                        </MenuItem>
                        <MenuItem >תבניות
                            <Link to="/message_templates" />
                        </MenuItem>
                        <MenuItem >הודעה חדשה
                            <Link to="/new_message" />
                        </MenuItem>
                    </SubMenu>
                    <SubMenu title="קבלני משנה" icon={<img src={providersStroke}/>}>
                        <MenuItem>כל הקבלנים
                            <Link to="/provider" />
                        </MenuItem>

                    </SubMenu>
            </Menu>
        </ProSidebar>;
    </div>
  );
};

export default SideMenu;


